class ClickableSlider(QSlider):
    def mousePressEvent(self, event: QMouseEvent) -> None:
        if event.button() == Qt.MouseButton.LeftButton:
            val = (
                self.minimum()
                + ((self.maximum() - self.minimum()) * event.position().x())
                / self.width()
            )
            val = round(val)
            self.setValue(val)

